import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App" style={{height: '100vh', overflow: 'auto'}}>
          <img src="https://upload.wikimedia.org/wikipedia/commons/5/5a/Lake_Wakatipu-HD.jpg" style={{height: '100%', width: '100%'}}></img>
          <h1 class="centered">Centered</h1>
        </div>
    );
  }
}
export default Home;
